import React from 'react';

class UsersListTable extends React.Component {

    render() {
        return <div>
            {this.props.users.map((user, index) => {
                return <div key={index} className="list-group-item">
                        <table className="table table-hover" >
                            {/*{this.props.users.map((user, index) => {
                        return <ul key={index} className="list-group-item">
                            <li>Name is: {user.name}, Age is: {user.age}, Country is: {user.country}</li>
                        </ul>
                    })
                    }*/}
                            <thead>
                            <tr>
                                <th scope="col">#</th>
                                <th scope="col">Имя</th>
                                <th scope="col">Возраст</th>
                                <th scope="col">Страна</th>
                            </tr>
                            </thead>
                            <tbody>
                            <tr>
                                <th scope="row">{user.id}</th>
                                <td>{user.name}</td>
                                <td>{user.age}</td>
                                <td>{user.country}</td>
                            </tr>
                            <tr>
                                <th scope="row">2</th>
                                <td>Jacob</td>
                                <td>Thornton</td>
                                <td>@fat</td>
                            </tr>
                            <tr>
                                <th scope="row">3</th>
                                <td colSpan="2">Larry the Bird</td>
                                <td>@twitter</td>
                            </tr>
                            </tbody>
                        </table>
                    </div>
            })
            }
            }
        </div>

        /*render(<UsersListTable />);*/
    }
}

export default UsersListTable;
